import React from "react";
import { Menu, Container } from "semantic-ui-react";

const NavBar = () => {
  return (
    <div>
      <Menu fixed="top" inverted>
        <Container>
          <Menu.Item name="home" />
          <Menu.Item name="messages" />
          <Menu.Item name="friends" />
        </Container>
      </Menu>
    </div>
  );
};

export default NavBar;
